import React, { Component } from 'react';
import SkillCard from './SkillCard';

class SkillSet extends Component {

  render() {
    return (
      <div class='container'>
        <div class='row'>
          <div class='col'>
            <p class='h3'>Front-end</p>
          </div>
          <div class='col'>
            <SkillCard />
          </div>
        </div>
      </div>
    )
  }
}

export default SkillSet;
